import { queryAllByAltText } from "@testing-library/dom";
import axios from "axios";
import React from "react";
import Image from "./Image";
import { useEffect, useState } from "react";

export default function TableRow({ row, tableData, tableDisplay, key, onClickPic }) {

  const renderRow =[tableData.map((el) => (
    <tr onClick={(e) => onClickPic(el.speciesCode)} className={el.comName}>
      <td colSpan="1">{el.comName}</td>
      <td colSpan="1">{el.sciName}</td>
      <td>{el.locName}</td>
      <td>{el.obsDt}</td>
    </tr>))]





  return (
    <div>
      {renderRow}
    </div>
  )
}
